import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M21 4a1 1 0 10-2 0v16a1 1 0 102 0V4z", fill: primaryFill }),
        React.createElement("path", { d: "M3 4.95a1.75 1.75 0 012.77-1.42l10.47 7.5c1 .72.97 2.23-.08 2.9L5.7 20.64A1.75 1.75 0 013 19.17V4.95z", fill: primaryFill }));
};
const Next24Filled = wrapIcon(rawSvg({}), 'Next24Filled');
export default Next24Filled;
